using namespace std;
//我的解法相当于亡羊补牢，通过补充判断条件来进行约束，但事实上问题是求最小公倍数。
class Solution {
public:
    bool hasGroupsSizeX(vector<int>& deck) {
        unordered_map<int,int> m;
        for(auto d:deck)
        {
            ++m[d];
        }
        int temp=INT_MAX;
        for(auto mm:m)
        {
            temp=min(temp,mm.second);
            cout<<mm.second<<endl;

        }
        cout<<temp<<endl;
        if(temp<2)
            return false;
        for(auto mm:m)
        {
            if(mm.second!=temp&&mm.second%temp!=0&&mm.second%2!=0)
                return false;
        }
        return true;
    }
};
class Solution1 {
public:
    bool hasGroupsSizeX(vector<int>& deck) {
        int res=0;
        unordered_map<int,int> m;
        for(auto d :deck)
        {
            ++m[d];
        }
        for(auto mm:m)
        {
            res=__gcd(mm.second,res);
        }
        return res>1;
    }
};
